import { Button, Card, CardHeader, CardMedia, CardContent } from "@mui/material";

const HomePage = () => {
    return (
        <>
        <Button variant="contained">Click Me!</Button>
        <Card variant="outlined">
            <CardMedia>
                <img src="../2037.png" />
            </CardMedia>
        </Card>
        </>
    )
}

export default HomePage;
